import React from 'react';

import mapMarkerImg from '../Images/mapMarker.svg'

function OrphanagesMap(){
    return(
        <div id="page-map">
            <aside>
                <header>
                    <img src={mapMarkerImg} alt="Marcação mapa"/>
                </header>
            </aside>
        </div>
    );
}

export default OrphanagesMap;
